import styled from "styled-components";

export const BodyCard = styled.div``;

export const Member = styled.div`
    position: relative;
    display: inline-block;
    max-width: 25%;
    width: 25%;
    text-align: center;

    .context{
        //position: absolute;
        display: block;
        bottom: 20px;

        ul.socialNet{
            display: flex;
            list-style: none;
            li{
                width: 23%;
                margin: 10px;
            }
        }
    }
`;
